message:
Eu tenho orado por ele pela família dele pra que Deus os use para os seus propósitos e que nesse processo o nosso presidente possa de fato de converter e continuar sendo benção como tem sido, economicamente e também em outras questões, na pandemia por exemplo ele poderia ter sido tirano como muitos foram mas ele não foi e ele tentou dizer a verdade dentro do possível pois sabia que não podia abrir muito a boca e acabar como alguns presidentes africanos que foram mortos, assim ele compremeteria o futuro da nação abrindo espaço para líderes piores.... Temos que orar pra que Deus derrame o Espírito Santo sobre ele dando sabedoria, fazendo ele entender o que ainda não entendeu, e se entregar por completo, que ele não resista a cumprir a vontade de Deus e que seja usado para cumprir aquilo q Deus determinar.. Orar pra que seja fortalecido a bíblia assim nos ensina em 1 Tim 2:1 Antes de tudo, recomendo que se façam súplicas, orações, intercessões e ações de graças por todos os homens;

2pelos reis e por todos os que exercem autoridade, para que tenhamos uma vida tranquila e pacífica, com toda a piedade e dignidade.
Se ele errar mesmo assim, Deus vai julgalo
